Confirmed that the function names _do_ appear in Chrome 49.0.2, Safari 9.0.3, Firefox 45.0b6, and Node 5.6.0, using the following code:

``` javascript
var cb = function() {
  throw new Error("foo");
};
setTimeout(cb, 1000);
```

